import React from 'react';
import { FilterValuesType } from '../App';
import '../App.css';

export type ButtonAddType = {
    onCockHandler:(filterValue:FilterValuesType) => void
    filterColorButton: (filter:FilterValuesType) => void
    value:FilterValuesType
}
export const ButtonAdd:React.FC<ButtonAddType> = (props) => {
    return ( <button className={props.filterColorButton  ? 'active-filter' : ' '} onClick={() => props.onCockHandler(props.value)}>{props.value}</button>

    )
}

export default ButtonAdd;
